import React from "react";
import ToDoListItem from "./ToDoListItem";

export default function ToDoList() {
  const toDos = [
    { description: "wake up", deadline: "2021-11-10 07:00" },
    { description: "Go to work", deadline: "2021-11-10 09:00" },
  ];
  return (
    <ul>
      {toDos.map((todo) => {
        return <ToDoListItem todo={todo} />;
      })}
    </ul>
  );
}
